/* Model terminate function */
void q_joints_terminate(void)
{
  /* Terminate for S-Function (hil_initialize_block): '<Root>/HIL Initialize' */

  /* S-Function Block: q_joints/HIL Initialize (hil_initialize_block) */
  {
    t_boolean is_switching;
    t_int result;
    t_uint32 num_final_analog_outputs = 0;
    t_uint32 num_final_digital_outputs = 0;
    hil_task_stop_all(q_joints_DW.HILInitialize_Card);
    hil_monitor_stop_all(q_joints_DW.HILInitialize_Card);
    is_switching = false;
    if ((q_joints_P.HILInitialize_set_analog_outp_a && !is_switching) ||
        (q_joints_P.HILInitialize_set_analog_out_lc && is_switching)) {
      num_final_analog_outputs = 8U;
    }

    if ((q_joints_P.HILInitialize_set_digital_out_l && !is_switching) ||
        (q_joints_P.HILInitialize_set_digital_out_g && is_switching)) {
      num_final_digital_outputs = 1U;
    }

    if (0
        || num_final_analog_outputs > 0
        || num_final_digital_outputs > 0
        ) {
      /* Attempt to write the final outputs atomically (due to firmware issue in old Q2-USB). Otherwise write channels individually */
      result = hil_write(q_joints_DW.HILInitialize_Card
                         , q_joints_P.HILInitialize_analog_output_cha,
                         num_final_analog_outputs
                         , NULL, 0
                         , &q_joints_P.HILInitialize_digital_output_ch,
                         num_final_digital_outputs
                         , NULL, 0
                         , q_joints_P.HILInitialize_final_analog_outp
                         , NULL
                         , (t_boolean *)
                         &q_joints_P.HILInitialize_final_digital_out
                         , NULL
                         );
      if (result == -QERR_HIL_WRITE_NOT_SUPPORTED) {
        t_error local_result;
        result = 0;

        /* The hil_write operation is not supported by this card. Write final outputs for each channel type */
        if (num_final_analog_outputs > 0) {
          local_result = hil_write_analog(q_joints_DW.HILInitialize_Card,
            q_joints_P.HILInitialize_analog_output_cha, num_final_analog_outputs,
            q_joints_P.HILInitialize_final_analog_outp);
          if (local_result < 0) {
            result = local_result;
          }
        }

        if (num_final_digital_outputs > 0) {
          local_result = hil_write_digital(q_joints_DW.HILInitialize_Card,
            &q_joints_P.HILInitialize_digital_output_ch,
            num_final_digital_outputs, (t_boolean *)
            &q_joints_P.HILInitialize_final_digital_out);
          if (local_result < 0) {
            result = local_result;
          }
        }

        if (result < 0) {
          msg_get_error_messageA(NULL, result, _rt_error_message, sizeof
            (_rt_error_message));
          rtmSetErrorStatus(q_joints_M, _rt_error_message);
        }
      }
    }

    hil_task_delete_all(q_joints_DW.HILInitialize_Card);
    hil_monitor_delete_all(q_joints_DW.HILInitialize_Card);
    hil_close(q_joints_DW.HILInitialize_Card);
    q_joints_DW.HILInitialize_Card = NULL;
  }
}
